import numpy as np
import tensorflow as tf
import pandas as pd
import matplotlib.pyplot as plt
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense, Dropout, BatchNormalization
from tensorflow.keras.optimizers import Adam
from sklearn.metrics import mean_absolute_error
from tensorflow.keras.callbacks import ReduceLROnPlateau, EarlyStopping

# Hyperparameters
EPOCHS = 50
BATCH_SIZE = 64
LEARNING_RATE = 0.001

# Forward Kinematics using DH parameters
def forward_kinematics(joint_angles):
    x = np.sum(np.cos(np.radians(joint_angles)))
    y = np.sum(np.sin(np.radians(joint_angles)))
    z = np.sum(np.tan(np.radians(joint_angles)))
    return np.array([x, y, z])

# Dataset Generation
def generate_dataset(samples=10000):
    joint_angles = np.random.uniform(low=[-180, -90, -90, -90, -90, -90, -30],
                                     high=[180, 30, 120, 90, 90, 90, 90], size=(samples, 7))
    positions = np.array([forward_kinematics(angles) for angles in joint_angles])

    positions = (positions - np.min(positions, axis=0)) / (np.max(positions, axis=0) - np.min(positions, axis=0))
    joint_angles = (joint_angles + 180) / 360

    df = pd.DataFrame(np.hstack((positions, joint_angles)), columns=['x', 'y', 'z', 'theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7'])
    df.to_excel("ik_training_data.xlsx", index=False)
    return positions, joint_angles

# Load Dataset
positions, joint_angles = generate_dataset(8000)
train_positions, test_positions = positions[:6000], positions[6000:]
train_angles, test_angles = joint_angles[:6000], joint_angles[6000:]

# ANN Model
model = Sequential([
    Dense(256, input_shape=(3,), activation='relu'),
    BatchNormalization(),
    Dropout(0.2),
    Dense(512, activation='relu'),
    BatchNormalization(),
    Dropout(0.2),
    Dense(512, activation='relu'),
    BatchNormalization(),
    Dropout(0.2),
    Dense(256, activation='relu'),
    Dense(7, activation='linear')
])

model.compile(optimizer=Adam(learning_rate=LEARNING_RATE), loss='mae')

# Callbacks
reduce_lr = ReduceLROnPlateau(monitor='val_loss', factor=0.5, patience=5, min_lr=1e-6)
early_stopping = EarlyStopping(monitor='val_loss', patience=10, restore_best_weights=True)

# Training
history = model.fit(train_positions, train_angles, epochs=EPOCHS, batch_size=BATCH_SIZE,
                    validation_split=0.1, callbacks=[reduce_lr, early_stopping])

# Evaluation
loss = model.evaluate(test_positions, test_angles)
print(f"Test Loss: {loss}")

# Testing the model with a sample target
sample_target = np.array([[1.5, 0.5, 0.3]])
predicted_angles = model.predict(sample_target)
predicted_angles = predicted_angles * 360 - 180

df_predicted = pd.DataFrame(predicted_angles, columns=['theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7'])
df_predicted.to_excel("ik_predicted_angles.xlsx", index=False)

print(f"Target Position: {sample_target}")
print(f"Predicted Joint Angles (Degrees): {predicted_angles}")

# Mean Absolute Error Calculation
predicted_test_angles = model.predict(test_positions)
predicted_test_angles = predicted_test_angles * 360 - 180
test_angles = test_angles * 360 - 180
mae = mean_absolute_error(test_angles, predicted_test_angles)
accuracy = 100 - (mae / 180 * 100)
print(f"Mean Absolute Error: {mae}")
print(f"Model Accuracy: {accuracy}%")

# Plot Training and Validation Loss
plt.figure(figsize=(10, 5))
plt.plot(history.history['loss'], label='Train Loss', marker='o')
plt.plot(history.history['val_loss'], label='Validation Loss', marker='s')
plt.xlabel('Epochs')
plt.ylabel('Loss')
plt.title('Training vs Validation Loss')
plt.legend()
plt.grid()
plt.show()

# Plot Predicted vs Actual Joint Angles for Each Joint
colors = ['r', 'g', 'b', 'c', 'm', 'y', 'k']
for i in range(7):
    plt.figure(figsize=(8, 4))
    plt.plot(test_angles[:100, i], label=f'Actual Theta {i+1}', linestyle='dashed', color=colors[i])
    plt.plot(predicted_test_angles[:100, i], label=f'Predicted Theta {i+1}', color=colors[i], alpha=0.7)
    plt.xlabel('Samples (First 100)')
    plt.ylabel('Joint Angle (Degrees)')
    plt.title(f'Predicted vs Actual Joint Angles for Theta {i+1}')
    plt.legend()
    plt.grid()
    plt.show()

