import pandas as pd
import numpy as np
from sklearn.model_selection import train_test_split
from sklearn.preprocessing import MinMaxScaler
from sklearn.ensemble import RandomForestRegressor
from sklearn.metrics import mean_absolute_error

# Load dataset
file_path = "/content/ik_scaled_training_data.xlsx"
df = pd.read_excel(file_path)

# Splitting features (X) and targets (y)
X = df[['x', 'y', 'z']].values
y = df[['theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7']].values

# Scaling X (xyz to range 1-10) and y (theta values to range 0-180)
scaler_X = MinMaxScaler(feature_range=(1, 10))
scaler_y = MinMaxScaler(feature_range=(0, 180))
#download the scaled up dataset
scaled_df = pd.DataFrame(np.hstack((X, y)), columns=['x', 'y', 'z', 'theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7'])
scaled_df.to_excel("ik_scaled_training_data.xlsx", index=False)
print(scaled_df.head())


X_scaled = scaler_X.fit_transform(X)
y_scaled = scaler_y.fit_transform(y)

# Split dataset into training and testing sets
X_train, X_test, y_train, y_test = train_test_split(X_scaled, y_scaled, test_size=0.2, random_state=42)

# Train a Random Forest model with optimized hyperparameters
rf_model = RandomForestRegressor(n_estimators=200, max_depth=15, min_samples_split=4, min_samples_leaf=2, random_state=42)
rf_model.fit(X_train, y_train)

# Make predictions
y_pred_scaled = rf_model.predict(X_test)

# Convert predictions back to original scale
y_pred = scaler_y.inverse_transform(y_pred_scaled)
y_test_original = scaler_y.inverse_transform(y_test)

# Calculate Mean Absolute Error
mae = mean_absolute_error(y_test_original, y_pred)
accuracy = 100 - (mae / 180 * 100)

print(f"Mean Absolute Error: {mae}")
print(f"Model Accuracy: {accuracy:.2f}%")
def predict_theta(x, y, z, model, scaler_X, scaler_y):
    # Scale input xyz
    input_scaled = scaler_X.transform(np.array([[x, y, z]]))

    # Predict scaled theta values
    theta_scaled = model.predict(input_scaled)

    # Inverse transform to get actual theta values
    theta_predicted = scaler_y.inverse_transform(theta_scaled)

    return theta_predicted[0]

# Example usage:
x_test_val, y_test_val, z_test_val = 5, 6, 7  # Example XYZ input
predicted_thetas = predict_theta(x_test_val, y_test_val, z_test_val, rf_model, scaler_X, scaler_y)
print(f"Predicted Joint Angles: {predicted_thetas}")

