# Splitting features (X) and targets (y)
X = df[['x', 'y', 'z']].values
y = df[['theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7']].values

# Scaling only X (xyz) using Standard Scaler
scaler_X = StandardScaler()
X_scaled = scaler_X.fit_transform(X)

# Convert X_scaled back to DataFrame to use .head() if needed for inspection
