import pandas as pd
from pycaret.regression import *

# Load dataset
file_path = "/content/ik_scaled_training_data2.xlsx"
df = pd.read_excel(file_path)

# Define features and target columns
X_cols = ['x', 'y', 'z']
y_cols = ['theta1', 'theta2', 'theta3', 'theta4', 'theta5', 'theta6', 'theta7']

# Dictionary to store models
models = {}

# Train separate models for each theta
for target in y_cols:
    print(f"\nTraining model for {target}...\n")

    # PyCaret setup
    regression_setup = setup(data=df, target=target, train_size=0.8, session_id=42)

    # Compare models and get the best one
    best_model = compare_models()

    # Finalize the best model
    final_model = finalize_model(best_model)

    # Save the trained model
    save_model(final_model, f"best_model_{target}")

    # Store the model
    models[target] = final_model

print("All models trained and saved successfully!")

